css`
    header, footer, div {
      padding: 0;
      flex-grow: 1;
      display: grid;
      grid-template-columns: min-content 1fr min-content;
    }


    header, footer {
      gap: var(--spacing);
      background-color: var(--back);
      color: var(--fore);
      line-height: var(--icon-size);
      font-size: var(--icon-size);
      /* border: 1px solid yellow; */
    }
    .right {
      text-align: right;
      background-color: pink;
    }

    header > .left,
    footer > .left,
    div > .left {
      background-color: yellow;
      display: flex;
    }

  `

